import React, { Component, Router, Switch, Route, App } from "react";
import { Chart, Tooltip, Axis, Legend, Bar, Line} from "viser-react";

import BankPersonal from "./Reactjs";

class DashBoard extends React.Component { // eslint-disable-line react/prefer-stateless-function

  constructor(props) {
    super(props);
    this.state = {
      organizations: null,
    };
    this.rowCallback = this.rowCallback.bind(this);
  }

  render() {
    <MyChildComponent orgs={this.state.organizations} />
  }
}
export default DashBoard;
